import Button from '@material-ui/core/Button';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';


function Createnote() {
    const [state, setstate] = useState()

    return (
        <>
            <div className="notes">
                <form>
                    <input type="text" placeholder="Title" />
                    <textarea rows="5" cols="50" placeholder="write a note..." autoComplete="off"></textarea>
                    <Button className="bttn"><AddCircleOutlineIcon className="btn-sign" /></Button>

                </form>

            </div>

        </>
    )
}

export default Createnote;
